import React from "react";
import "./SquareTable.css";

const SquareTable = (props) => {
  return (
    <table>
      <tr>
        <td>
          <button>{props.inputFromGame}</button>
        </td>
        <td>
          <button>{props.inputFromGame}</button>
        </td>
        <td>
          <button>{props.inputFromGame}</button>
        </td>

      </tr>
    </table>
  );
};
export default SquareTable;
